/*import { useState } from "react";*/
function Password(props) {

    const {delta,setPassowrd} = props

    function PassSrrength(){
        if(delta < 100){
            setPassowrd("weak");
            return "weak";
        }
        if(delta >= 100 && delta <= 1000000) {
            setPassowrd("medium");
            return "medium";
        }
        if(delta > 1000000){
            setPassowrd("strong");
            return "strong";
        }
        }
        

  return (
    <div>
        <h3> password is {PassSrrength}</h3>
    </div>
  );
}

export default Password;
